import React from 'react';

const Card = (item) => {
    return (
        <div style={{backgroundImage: `url(${item.item.cover})`, backgroundSize: "cover"}}>
            <img src={item.item.cover} alt="" style={{width: '20%'}}/>
            <p>{item.item.title}</p>
        </div>
    );
};

export default Card;
